import axios from "axios";
import { createAsyncThunk } from "@reduxjs/toolkit";
import { useDispatch } from "react-redux";
import { Homesliceactions } from "../slices/Homeslice";

export const Fetchaction = createAsyncThunk("fetchdata", async () => {
  try {
    const response = await axios.get(
      "https://newsapi.org/v2/everything?q=arsenal&apiKey=7173ba4376974fb9a65234a9632ba689"
    );
    
    return response.data;
  } catch (error) {
    throw error;
  }
});
